import Link from "next/link";
import Head from "next/head";

import Footer from "../components/Footer";

const Index = () => (
  <div>
    <Head>
      <title>Index</title>
    </Head>
    Hello from Next.js
    <Link href="/about">
      <a>About</a>
    </Link>
    <Footer />
  </div>
);

export default Index;
